import React, { useState, useEffect } from 'react'
import axios from "axios"
import { Route, Link } from "react-router-dom"
import Header from "./components/header"
import Picturepage from "./components/picturepage"
import Footer from "./components/footer"
import Search from "./components/search"
import css from "./App.css"

// const imagesUrl = "https://api.unsplash.com/photos/?page=1&per_page=9&client_id=1kV8nZ5_pV1wBQJB_prZ0Rs5pkpTarBY2-NNW7X-_yg"
const imagesUrl = "https://api.unsplash.com/search/photos?page=1&query=office&client_id=1kV8nZ5_pV1wBQJB_prZ0Rs5pkpTarBY2-NNW7X-_yg"



export default function App() {

  const [images, updateimages] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const images = await axios(imagesUrl)
      console.log(images)
      console.log(images.data)


      updateimages(images.data)
    }
    apiCall()
  }, [])


  return (
    <>

      <nav> 
      <Header />
        <Search />
        </nav>
        <Route path="/picturepage/:id">
        <Picturepage />
        </Route>

      <Route path="/" exact>
        <Link to="/picturepage">
          {images.map(image => <img src={image.urls.small}></img>)}
          </Link>
      </Route>
      <Footer />


    </>
  )
}
